I am Working with UI5, where the MVC Classes look like this:

```typescript
abstract class Controller {
    public static controllerName: string;
    private models: { [name: string]: ModelingReduxModel<any, any, any> };
    public getView: { (): View };
}

abstract class View extends sap.ui.core.Control {
    public static viewName: string;
    public static controller: typeof Controller;

    public abstract createContent(controller: Controller): any;
    public getController: { (): Controller };
}
```

An Implementation might then look like this:
```typescript
class MyController extends Controller {
    public static controllerName = "MyController";
}

class MyView extends View {
    public static controller = MyController;
    public static viewName = "MyView ";
}
```

I am trying to find a generic type for `View.getController` which infers the correct sub-class for each view, so the `ReturnType<MyView.getController>` should be `MyController` instead of `typeof Controller`, but I cannot for the life of me figure it out.

I know that it's possible, because we alread have a very ugly workaround, based on a the `createContent` parameter:
```typescript 
public getController: { <This extends View>(this: This): Parameters<This["createContent"]>[0] };
```
While this technically works and figures out the correct controller class and thus leads to better value help, the return type of getController isn't shown as the controller class:
![image](https://user-images.githubusercontent.com/9429273/206387529-66eb9496-4ee6-4c4d-a13f-4e517df2e9b9.png)

This might be a bug already, because the Type System knows the MyController class at this point, because all its members appear in the value help.
However, as I said this is a workaround and I hate it 😅

The closest alternative I've got so far, which I thought should work was this:
```typescript
public getController: { <This extends typeof View >(this: InstanceType<This>): This["controller"] };
```
But it seems to ignore what `this` is, all I get is still `typeof Controller`, with an additional error:
`Type 'This' does not satisfy the constraint 'new (...args: any) => any'.
  Type 'typeof View' is not assignable to type 'new (...args: any) => any'.
    Cannot assign an abstract constructor type to a non-abstract constructor type.ts(2344)`

It feels like I am really close already, but I am out of ideas and any help is highly appreciated.

